import React from 'react'
import NoteOutlinedIcon from '@material-ui/icons/NoteOutlined';
import './Header.css'

export default function Header(props){



    return (
        <header> 
        <h1>{props.headerName}</h1>
        <NoteOutlinedIcon 
        onClick={()=>{
            props.history.push('/keeper')
        }}
        className='noteIcon'/>
        </header>
    )}
